import * as React from 'react';
import styles from './index.module.less';
import BoldenInformation from '../../common/BoldenInformation';
import PharseInformation, { IPharseInfo } from '../../common/PharseInformation';

interface IProps {
  info: IPharseInfo;
  time: string[];
  title?: string;
}
const Phrase: React.FC<IProps> = props => {
  const { info, time, title } = props;
  return (
    <div className={styles['main']}>
      {title && <div className={styles['pharse-title']}>{title}</div>}
      <div className={styles['pharse-container']}>
        <PharseInformation info={info}/>
        <BoldenInformation informations={time} align={'right'} />
      </div>
    </div>
  );
};

export default Phrase;
